function App() {


    const dates = []

    const date = new Date()

    const month = date.getMonth()
    const year = date.getFullYear()

    const d = new Date(year, month + 1, 0);
    const lastDate = d.getDate();


    for(let i = 1; i <= lastDate; i++){
        dates.push(i)
    }


    return (
        <div className="App">
            {
               dates
            }
        </div>
    );
}

export default App;
